import React from 'react';
import { makeStyles } from '@material-ui/core/styles';
import { Drawer, Divider, List, ListItem, ListItemIcon, ListItemText } from "@material-ui/core";
import { indigo } from "@material-ui/core/colors";
import { AccessTime, NotificationsActive, Face } from "@material-ui/icons";
import { withRouter } from "react-router-dom";

const drawerWidth = 230;
const DashboardDrawer = props => {
  const { isDrawerOpen, setDrawerOpen } = props;
  const classes = useStyles();
  return (
    <Drawer
      className={classes.drawer}
      variant="persistent"
      anchor="left"
      open={true}
      classes={{ paper: classes.drawerPaper }}
    >
      <List style={{ marginTop: "-8px" }}>
        <ListItem button key={"timetable"} onClick={() => {
          props.history.push("/dashboard");
          setDrawerOpen(false);
        }}>
          <ListItemIcon><AccessTime style={{ color: "white" }} /></ListItemIcon>
          <ListItemText primary={"Time Table"} />
        </ListItem>
        <Divider />
        <ListItem button key={"announcements"} onClick={() => {
          props.history.push("/dashboard/announcements");
          setDrawerOpen(false);
        }}>
          <ListItemIcon><NotificationsActive style={{ color: "white" }} /></ListItemIcon>
          <ListItemText primary={"Announcements"} />
        </ListItem>
        <Divider />
        <ListItem button key={"profile"} onClick={() => {
          props.history.push("/dashboard/profile");
          setDrawerOpen(false);
        }}>
          <ListItemIcon><Face style={{ color: "white" }} /></ListItemIcon>
          <ListItemText primary={"My Profile"} />
        </ListItem>
      </List>
    </Drawer>
  );
};

const useStyles = makeStyles(theme => ({
  drawer: {
    width: drawerWidth,
    flexShrink: 0,
    marginTop: "60px",
    background: "blue"
  },
  drawerPaper: {
    width: drawerWidth,
    marginTop: "64px",
    background: indigo[700],
    color: "white"
  },
  drawerHeader: {
    display: 'flex',
    alignItems: 'center',
    padding: theme.spacing(0, 1),
    ...theme.mixins.toolbar,
    justifyContent: 'flex-end',
  }
}));

export default withRouter(DashboardDrawer);
